webpackJsonp([32169873434621],{"./node_modules/json-loader/index.js!./.cache/json/quick-update-gsoc-html.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p>Mid term evaluation is coming up soon so working hard at cleaning up code as I can be quite messy while trying to get things to work. Also was starting to realise that alot of the modules I’ve been adding are sim card dependent so I’ve added seperate views depending on whether the device has a sim card or not.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.41379310344827%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshots"\n        title=""\n        src="/static/7e473e73170547593b12477a9835a1d8-7ee4f.png"\n        srcset="/static/7e473e73170547593b12477a9835a1d8-785d5.png 148w,\n/static/7e473e73170547593b12477a9835a1d8-2f066.png 295w,\n/static/7e473e73170547593b12477a9835a1d8-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>',frontmatter:{date:"June 29, 2012",path:"/quick-update-gsoc.html",tags:["tag"],title:"Quick update",image:{childImageSharp:{resize:{src:"/static/4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"This years Google Summer of Code is drawing to a close, I’ve finalised all the functionality of my project and now it’s crossing fingers that I don’t hear back about any bugs. This week coming I’ll be providing my final evaluation and by next week it...",html:'<p>This years Google Summer of Code is drawing to a close, I’ve finalised all the functionality of my project and now it’s crossing fingers that I don’t hear back about any bugs.</p>\n<p>This week coming I’ll be providing my final evaluation and by next week it will all be over.</p>\n<p>It’s been a fun journey, having learnt so much along the way that I now consider myself a  more accomplished programmer, but of course at the same time I’ve learnt a lot about how I can improve for next time!</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 213px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 140.84507042253523%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="pandroid"\n        title=""\n        src="/static/97f4e5ff2240f9574ffe987e5cf6503c-af99f.png"\n        srcset="/static/97f4e5ff2240f9574ffe987e5cf6503c-a20d6.png 148w,\n/static/97f4e5ff2240f9574ffe987e5cf6503c-af99f.png 213w"\n        sizes="(max-width: 213px) 100vw, 213px"\n      />\n    </span>\n  </span>\n  </p>\n<p>You can try out my app right now by grabbing the pandroid apk file from <a href="https://dl.dropboxusercontent.com/u/17033926/partiallogic/Pandroid%20Agent%20v3.0.apk">here</a> and if you notice anything you don’t like, please <a href="http://twitter.com/_markholland">let me know!</a></p>\n<p>And of course a huge shout out to <a href="http://twitter.com/slerena">Sancho Lerena</a>, <a href="http://www.noparar.com/">Sergio Martin Zarzuelo</a> and everyone else at <a href="http://www.pandorafms.com/">PandoraFMS</a> for giving me the opportunity to work with them.</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2012-08-19-drawing-to-a-close/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2012-08-19T12:00:00+00:00",path:"/drawing-to-a-close-gsoc.html",tags:["tag"],title:"Drawing to a close"}},next:{excerpt:"Today I’ve got a neat little service to share that I’ve found useful on those very rare ocassions where I’ve needed to manipulate pdfs that I didn’t create myself. It’s called  FoxyUtils  and it’s a cloud service that allows you to merge or split...",html:'<p>Today I’ve got a neat little service to share that I’ve found useful on those very rare ocassions where I’ve needed to manipulate pdfs that I didn’t create myself.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 150px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.33333333333334%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="foxyutils"\n        title=""\n        src="/static/13037aac915c28e9db42a36560542c50-fbc36.png"\n        srcset="/static/13037aac915c28e9db42a36560542c50-ea778.png 148w,\n/static/13037aac915c28e9db42a36560542c50-fbc36.png 150w"\n        sizes="(max-width: 150px) 100vw, 150px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It’s called <a href="http://foxyutils.com/blog/archive/">FoxyUtils</a> and it’s a cloud service that allows you to merge or split pdfs that the user uploads, you can also unlock and encrypt pdfs but I’ve only used the splitting and merging functions.</p>\n<p>Now being a cloud service I should add the same disclaimer as any other service where you have to upload your own data, even though none of the uploaded pdfs are made public they’re still becoming a lot less safer than if you’d kept them on your hard drive so be wary if you use it with any sensitive material.</p>\n<p>But if that’s not a problem in your case then I highly recommend <a href="http://foxyutils.com/blog/archive/">FoxyUtils</a>, it’s a perfect example of the sort of thing where you would have had to find and download a program to perform a 30 second job.</p>\n<p><a href="http://foxyutils.com/blog/archive/">www.foxyutils.com</a></p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2012-06-22-foxyutils/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2012-06-22T12:00:00+00:00",path:"/foxy-utils.html",tags:["tag"],title:"FoxyUtils"}}}}}});
